script: |
  super -f text -I q4290.spq | sort > q4290.out

inputs:
  - name: q4290.spq
    data: |
      SELECT DISTINCT - col1 FROM tab1 (FORMAT parquet) WHERE NOT + - 94 BETWEEN - 12 AND - - col1 * + col1 * 81 * 89;
  - name: tab1

outputs:
  - name: q4290.out
    data: |
      -14
      -47
      -5
